from collections import defaultdictclass Solution(object):    def fourSumCount(self, A, B, C, D):        """        :type A: List[int]        :type B: List[int]        :type C: List[int]        :type D: List[int]        :rtype: int        """        dict1,dict2,ans = {},{},0        for i in range(len(A)):            for j in range(len(B)):                if A[i]+B[j] not in dict1:                    dict1[A[i]+B[j]]=1                else:                    dict1[A[i] + B[j]] +=1        for i in range(len(C)):            for j in range(len(D)):                if C[i]+D[j] not in dict2:                    dict2[C[i]+D[j]]=1                else:                    dict2[C[i] + D[j]] +=1        for key,val in dict1.items():            if -key in dict2:                ans+=val*dict2[-key]        return anss = Solution()A=[1,2]B=[-2,-1]C=[-1,2]D=[0,2]print(s.fourSumCount(A,B,C,D))